import React from 'react';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';

import Home from './screen/HomePage';
// import Pesanan from './screen/OrderPage';
// import Pembatalan from './screen/CancelPage';
// import Lainnya from './screen/OtherPage';

const Tab = createBottomTabNavigator();

const ScreenTab = () => {
    return (
        <Tab.Navigator>
            <Tab.Screen name="Home" component={Home}/>
            {/* <Tab.Screen name="Pesanan" component={Pesanan}/>
            <Tab.Screen name="Pembatalan" component={Pembatalan}/>
            <Tab.Screen name="Lainnya" component={Lainnya}/> */}
        </Tab.Navigator>
    )
}
